    selectedGroupIds: string[];
    setSelectedGroupIds: (groupIds: string[]) => void;
  }

  const CheckboxContext = createContext<ICheckboxContext>({
    selectedGroupIds: [],
    setSelectedGroupIds: (groupIds: string[]) => {
      setSelectedGroupIds(groupIds);
    }
  });
